import React from 'react';
import { ProfileContainer, ProfileHeader } from '../Profile';

function Profile() {
  return (
    <ProfileContainer>
      <ProfileHeader>
        <div className='profile-header'>
          <div className='profile-header__left'>
            <div className='profile-header__user'>
              <img
                src='https://images.unsplash.com/photo-1559548331-f9cb98001426?ixlib=rb-1.2.1&ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&auto=format&fit=crop&w=1050&q=80'
                alt=''
                srcset=''
              />
            </div>
          </div>
          <div className='profile-header__right'></div>
        </div>
      </ProfileHeader>
    </ProfileContainer>
  );
}

export default Profile;
